import timeit

class Solution:
    def splitCharCheck(self,s):
        _sucess = True
        for cha in range(len(s)):
            occurance = s.split(s[cha])
            if len(occurance) > 2:
                _sucess = False
                break
        return _sucess

    def lengthOfLongestSubstring(self, s: str):
        theWord = ""
        checkWord = ""
        score = 0
        ch = 0
        while len(s) != 0 and score < len(s) and 94 >= len(theWord):
            checkWord = checkWord + (s[ch])
            if self.splitCharCheck(checkWord) and score < len(checkWord):
                theWord = checkWord
                score = len(checkWord)
            if ch == (len(s)-1):
                checkWord = ""
                s = s[1:]
                ch = 0
            else:
                ch += 1

        return len(theWord)

